import React from "react";
import { NavLink } from "react-router-dom";

const navbar = () => {
  const uid = useContext(UidContext);
  return (
    <nav>
      <div className="nav-container">
        <div className="logo">
          <NavLink exact to="/">
            <div className="logo">
              <img src="./img/iconGus.png" alt="Logo-Gus" />
              <h3>The Gus Network</h3>
            </div>
          </NavLink>
        </div>
      </div>
    </nav>
  );
};

export default navbar;
